import Card from "./Card";
import products from "./ItemName";
const ShowItem = (props) => {
  const cardVisible = () => {
       props.deleteicon=true
  };
  return (
    <>
      {props.deleteicon === true ? (
        <div
          style={{
            position: "Fixed",
            boxShadow: "3px 3px 5px black",
            zIndex: "1",
            top: "20%",
            left: "25%",
            backgroundColor: "white",
            width: "50%",
            height: "50%",
          }}
        ></div>
      ) : (
        ""
      )}
      <div
        style={{
          display: "flex",
          zIndex: "-1",
          width: "100%",
          height: "100%",
          flexDirection: "row",
          border: "2px solid red",
          flexWrap: "wrap ",
        }}
      >
        {products.map((val, index) => {
          return <Card deleteFunc={cardVisible} item={val} key={index}  />;
        })}
      </div>
    </>
  );
};

export default ShowItem;
